var numberPerPage = 1;
var numberOfPages = jsonData.length / numberOfPages;
var currentPage = 1;
var pageList = new Array();


function loadJSON(callback, path) {
    var xobj = new XMLHttpRequest();
    xobj.overrideMimeType("application/json");
    xobj.open('GET', path, true);

    xobj.onreadystatechange = function() {
        console.log(xobj)
        if (xobj.readyState == 4 && (xobj.status === 200 || xobj.status === 0)) {
            // .open will NOT return a value but simply returns undefined in async mode so use a callback
            callback(xobj.responseText);
        }
    }
    xobj.send(null);

}

function getNumberOfPages() {
    return Math.ceil(jsonData.length / numberPerPage);
}

function loadDataset(records) {
    var count = Object.keys(records).length;
    getNumberOfPages();
    var numberOfPages = getNumberOfPages();

    console.log('Total training examples ' + count);
}

function getImgPath(img) {
    var path = img.replace("../psiturk-habitat-sim/", "");
    return path;
}


function drawList() {
    var tableList = [];
    var gtImgElement = "<div class='col m3 col-image'> <b>Grount truth observation</b> </div>";
    var predImgElement = "<div class='col m3 col-image'> <b>Pred observation</b> </div>";
    var element = "<div class='row img-row' style='text-align: left'> <div class='col m1 col-image'> <b>Frame Id</b> </div>" + gtImgElement + predImgElement + " <div class='col m1 col-image'> <b>Obs L2 Distance</b> </div> <div class='col m1 col-image'> <b>Action match</b> </div> <div class='col m3 col-image'> <b>Object Pos diff</b> </div> </div>";
    tableList.push(element);
    for (var i = 0; i < pageList.length; i++) {
        var record = pageList[i];
        for (var r = 0; r < record.length; r++) {

            var objectPosStr = "";
            var objectDistMap = record[r]["object_dist_map"];
            for (let key in objectDistMap) {
                var objectDist = objectDistMap[key];
                objectPosStr += "<b>" + key + "</b> :<br>";
                for (let distKey in  objectDist) {
                    if (distKey.includes("trans")) {
                        objectPosStr += "position: " + objectDist[distKey] + "<br>";
                    } else if (distKey.includes("rot")) {
                        objectPosStr += "rotation: " + objectDist[distKey] + "<br>";
                    }
                }
                objectPosStr += "<br>";
            }
            var gtImgPath = getImgPath(record[r]["gt_img"]);
            var predImgPath = getImgPath(record[r]["pred_img"]);
            var gtNextActionElement = "GT Next Action: " + record[r]["gt_next_action"] + " <br>";
            var gtPrevActionElement = "GT Prev Action: " + record[r]["gt_prev_action"] + " <br>";

            var predNextActionElement = "Pred Next Action: " + record[r]["pred_next_action"] + " <br>";
            var predPrevActionElement = "Pred Prev Action: " + record[r]["pred_prev_action"] + " <br>";

            var agentPosDiff = "<div class='row'> <div class='col m12 col-image' style='text-align: left'> Agent pos diff:<br> translation: " + record[r]["agent_l2_distance"] + "<br> rotation: " + record[r]["agent_rot_distance"] +  "<br> sensor rotation: " + record[r]["sensor_quat_distance"] +  " </div> </div>";

            var objectPosDiff = "<div class='col m3 col-image' style='text-align: left'> Object Pos diff:<br> " + objectPosStr + " </div>";

            var gtActionElement = "<div class='col m12 col-image' > " + gtNextActionElement + gtPrevActionElement + " </div>";
            var predActionElement = "<div class='col m12 col-image'> " + predNextActionElement + predPrevActionElement + " </div>";

            var gtImgElement = "<div class='col m3 col-image'> <div class='row' style='text-align: left'> <img src='" + gtImgPath + "' width='224' height='224'> </div> <div class='row'>" + gtActionElement +" </div> " + agentPosDiff + " </div>";
            var predImgElement = "<div class='col m3 col-image'> <div class='row' style='text-align: left'> <img src='" + predImgPath + "' width='224' height='224'> </div> <div class='row'> " + predActionElement + " </div> </div>";

            var element = "<div class='row img-row' style='text-align: left'> <div class='col m1 col-image'> " + (r + 1) + " </div>" + gtImgElement + predImgElement + " <div class='col m1 col-image'> " + record[r]["obs_l2_dist"].toFixed(3) + " </div> <div class='col m1 col-image'> " + record[r]["match"] + " </div>" + objectPosDiff + " </div>";
            tableList.push(element);
        }
    }
    document.getElementById("results").innerHTML = tableList.join("\n");
}

function check() {
    document.getElementById("next").disabled = currentPage == numberOfPages ? true : false;
    document.getElementById("previous").disabled = currentPage == 1 ? true : false;
}

function loadList() {
    var begin = ((currentPage - 1) * numberPerPage);
    var end = begin + numberPerPage;

    pageList = jsonData.slice(begin, end);
    drawList();
    check();
}

function nextPage() {
    currentPage += 1;
    loadList();
}

function previousPage() {
    currentPage -= 1;
    loadList();
}

function firstPage() {
    currentPage = 1;
    loadList();
}

function lastPage() {
    currentPage = numberOfPages;
    loadList();
}


function load() {
    loadDataset(jsonData);
    loadList();
}

window.onload = load;